import React from 'react';

export default function MovieForm(props) {

  let { movie } = props;

  return (
    <React.Fragment>
      {
        movie ? (
          <h1>{props.movie && props.movie.title} edit</h1>
        ) : null
      }
    </React.Fragment>
  );
};
